import React, { useState } from "react";

const counter = () => {
  const [count, setCount] = useState(0);

  function increment() {
      setCount(count+1)
  }
  return (
    <div>
      <h2>Counter</h2>
      <button onClick={increment}>+</button>
      <span>{count}</span>
      {/* <button onClick={decrement}> -</button> */}
    </div>
  );
};

export default counter;
